import { useEffect , useState} from 'react';
import {GetExternalDataProps} from '../types';

const GetExternalData = ({...props}: GetExternalDataProps) => {
    const [data, setData] = useState([]);
    const [loading, isLoading] = useState(true);
    useEffect(() => {
        fetch(props.link).then((result: any) => {
            setData(result);
            isLoading(false);
        });
    });
    return [data, loading];
};
export default GetExternalData;
